description:
Flikken Maastricht SEIZOEN 10 AFLEVERING 1

&quot;Overvallen&quot;

Op een industrieterrein is een man getuige van een professioneel uitgevoerde brute overval op een geldkantoor, waarbij zeer zware wapens worden gebruikt en een dode valt. Wolfs en Eva zijn snel ter plaatse en er volgt een wilde achtervolging. Na een heftig vuurgevecht ontsnappen de daders en komen Wolfs en Eva erachter dat de dode jongeman eerder betrokken was bij een klungelig mislukte poging tot roof. Aangezien dat van geen kanten rijmt met deze professionele overval moeten ze alles uit de kast halen om uit te zoeken met wie de jongen het geldkantoor overvallen heeft en hoe ze aan hun zware wapens kwamen. Twee broers uit het criminele circuit die elkaars bloed wel kunnen drinken, treffen elkaar voor het eerst sinds hun ruzie, bij de begrafenis van hun moeder. De familie is bang dat dit ernstig uit de hand gaat lopen. Romeo en Marion gaan poolshoogte nemen
